import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import AuthLayout from '../components/auth/AuthLayout';
import AuthHeader from '../components/auth/AuthHeader';
import SocialLogin from '../components/auth/SocialLogin';
import AuthButton from '../components/auth/AuthButton';

const Register = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [error, setError] = useState('');
    const [isLoading, setIsLoading] = useState(false);
    const navigate = useNavigate();

    const validateForm = () => {
        if (password.length < 8) {
            setError('รหัสผ่านต้องมีความยาวอย่างน้อย 8 ตัวอักษร');
            return false;
        }
        if (password !== confirmPassword) {
            setError('รหัสผ่านไม่ตรงกัน');
            return false;
        }
        return true;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');

        if (!validateForm()) {
            return;
        }

        setIsLoading(true);
        try {
            // API call would go here
            // const response = await api.register(email, password);
            
            // Simulate API call
            await new Promise(resolve => setTimeout(resolve, 1000));
            
            // Navigate to home on success
            navigate('/home');
        } catch (err) {
            setError('เกิดข้อผิดพลาด โปรดลองใหม่อีกครั้ง');
        } finally {
            setIsLoading(false);
        }
    };

    const handleGoogleRegister = async () => {
        setError('');
        setIsLoading(true);

        try {
            // Google OAuth registration would go here
            // const response = await api.googleRegister();
            
            // Simulate API call
            await new Promise(resolve => setTimeout(resolve, 1000));
            
            // Navigate to home on success
            navigate('/home');
        } catch (err) {
            setError('เกิดข้อผิดพลาดในการสมัครสมาชิกด้วย Google');
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <AuthLayout>
            <AuthHeader 
                title="สร้างบัญชีใหม่"
                subtitle="เริ่มต้นการเดินทางสู่สุขภาพที่ดีกว่ากับ FitAddict"
                linkText="เข้าสู่ระบบ"
                linkPath="/login"
                linkLabel="มีบัญชีอยู่แล้ว?"
                isLoading={isLoading}
            />

            <SocialLogin 
                onClick={handleGoogleRegister}
                isLoading={isLoading}
                type="register"
            />

            <form onSubmit={handleSubmit} className="auth-form">
                <div className="form-group">
                    <label htmlFor="email">อีเมล</label>
                    <input
                        type="email"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="กรอกอีเมลของคุณ"
                        required
                        disabled={isLoading}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="password">รหัสผ่าน</label>
                    <input
                        type="password"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="กรอกรหัสผ่าน (อย่างน้อย 8 ตัวอักษร)"
                        required
                        disabled={isLoading}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="confirmPassword">ยืนยันรหัสผ่าน</label>
                    <input
                        type="password"
                        id="confirmPassword"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        placeholder="กรอกรหัสผ่านอีกครั้ง"
                        required
                        disabled={isLoading}
                    />
                </div>

                <div className="auth-actions">
                    <AuthButton
                        type="submit"
                        disabled={isLoading}
                    >
                        {isLoading ? 'กำลังดำเนินการ...' : 'สมัครสมาชิก'}
                    </AuthButton>
                </div>
            </form>

            {error && <div className="error-message">{error}</div>}
        </AuthLayout>
    );
};

export default Register;
